'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class RemoveOrderCommand extends SendSingleCommandWithoutResponse {
    accountId;
    orderId;
    constructor() {
        super();
        this.commandName = "RemoveOrderCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createRemoveOrderRequestMessage(this.tradingSession, this.accountId, this.orderId, this.requestNumberGenerator, stdlib.nowutc());
    }
}
module.exports = RemoveOrderCommand
